// InscriptionTournoi.js
import React, { useState } from 'react';
import '../Style/Inscription.css'; // Assurez-vous de créer ce fichier et d'y ajouter les styles appropriés
import logoConnexion from '../Images/LOGO2.png'; 
import Navbar from './Navbar';
import Tapbar from './Tapbar';

function Creation() {
    // Définissez votre état et vos gestionnaires ici

    return (
        <div className="form-container">
            <div className="logo-container">
                <img src={logoConnexion} alt="Logo Connexion" />
            </div>
            <h2>Nouveau Tournoi</h2>
            <input type="text" placeholder="Catégorie" />
            <input type="text" placeholder="Niveau" />
            <input type="text" placeholder="Date" />
            <input type="text" placeholder="Nombre d'équipes" />

            <button>Création du tournoi </button>
            <Navbar />
            <Tapbar/>
           
        </div>
    );
}

export default Creation;



